import CustomerRow from "./AdminCustomerTableRows";
import React from "react";
export default function AdminMessagesTable(){
    const messages = [
        { id: 1, clientName: 'Umut AVCI', movie: 'Spiderman', hall : "1", description : "" },
        { id: 1, clientName: 'Samet AVCI', movie: 'Spiderman', hall : "2", description : "" },
        { id: 1, clientName: 'Cihan Can', movie: 'Spiderman', hall : "3", description : "" }
    ]
    return (
        <div className="overflow-x-auto mt-8">
            <table className="min-w-full border border-gray-200 rounded-md overflow-hidden">
                <thead className="bg-gray-50 text-gray-700 text-sm font-semibold">
                <tr>
                    <th className="px-4 py-2 text-center">Customer ID</th>
                    <th className="px-4 py-2 text-center">Customer Name</th>
                    <th className="px-4 py-2 text-center">Customer Email</th>
                    <th className="px-4 py-2 text-center"></th>
                </tr>
                </thead>
                <tbody className="bg-white">
                {messages.map((message) => (
                    <CustomerRow key={message.id} customer={message} />
                ))}
                </tbody>
            </table>
        </div>
    )
}
